import React from 'react';
import { Row, Col, Button, Tooltip } from 'antd';
import { UserOutlined } from '@ant-design/icons';

const Dashboard = () => {
    return (
        <div className="Home">
            <div className="Home-header">
                <Row justify="center">
                    Social Media Mistake Eraser
                    <Tooltip style={{rigt: "0px"}} title="User Profile">
                        <Button type="primary" shape="circle" icon={<UserOutlined />} />
                    </Tooltip>
                </Row>
            </div>
                <Row>
                    <Col xs={{ span: 5, offset: 1 }} lg={{ span: 6, offset: 2 }}>Searches</Col>
                    <Col xs={{ span: 11, offset: 1 }} lg={{ span: 6, offset: 2 }}>Twitter Handle</Col>
                    <Col xs={{ span: 5, offset: 1 }} lg={{ span: 6, offset: 2 }}>Status</Col>
                </Row>
        </div>
    );
};

export default Dashboard;
